import {  Route, Router, Switch } from 'react-router-dom';
import EmployeeList from './Pages/EmployeeList';
import Home from './Pages/Home';



function App() {
  return (


   <Router>
     <Switch>
    <Route path='/' exact component={Home}/>
    <Route path='/employee' component={EmployeeList}/>
    </Switch>
   </Router>


  );
}

export default App;
